import "./ExpenseFilter.css";

function ExpenseFilter() {
  return (
    <div className="expense-filter">
      <label >Filter by Year</label>
      <select className='expense-filter-dropdown'>
        <option>2019</option>
        <option>2020</option>
        <option>2021</option>
        <option>2022</option>
      </select>
    </div>
  );
}

export default ExpenseFilter;
